INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES (1, "2020/04/30 12:00:00", 0, 0.0, 0.0, 10040, 1, "2030/12/17 14:59:59", 24, 102601, 0.0, "リン", "あたしだって\nやるときはやるよ！", 24001);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES (1, "2020/04/30 12:00:00", 1, 0.0, 0.0, 10040, 1, "2030/12/17 14:59:59", 24, 102601, 0.0, "リン", "ふぅ…\nこれであたしの仕事は\n終わりだね", 24002);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES (1, "2020/04/30 12:00:00", 2, 0.0, 0.0, 10040, 1, "2030/12/17 14:59:59", 24, 102601, 0.0, "リン", "終わった終わった\n一人でもなんとか\nなるもんだね", 24003);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES (2, "2020/04/30 12:00:00", 3, 0.0, 0.0, 10040, 2, "2030/12/17 14:59:59", 24, 102601, 0.0, "リン", "やったね！\nこれでようやく\nサボれるよ…", 24004);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES (1, "2020/04/30 12:00:00", 4, 0.0, 0.0, 10040, 1, "2030/12/17 14:59:59", 24, 102601, 0.0, "リン", "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", 24005);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES (2, "2020/04/30 12:00:00", 5, 0.0, 0.0, 10040, 2, "2030/12/17 14:59:59", 24, 102601, 0.0, "リン", "あたしを敵に回した\n恐ろしさ\n思い知ったか！", 24006);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES (2, "2020/04/30 12:00:00", 6, 0.0, 0.0, 10040, 2, "2030/12/17 14:59:59", 24, 102601, 0.0, "リン", "あたしも意外と\nやるもんでしょ？", 24007);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES (4, "2020/04/30 12:00:00", 7, 0.0, 0.0, 10040, 4, "2030/12/17 14:59:59", 24, 102601, 0.0, "リン", "疲れた…\nねずみの逃げ足\n速すぎるよ…", 24008);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES (4, "2020/04/30 12:00:00", 8, 0.0, 0.0, 10040, 4, "2030/12/17 14:59:59", 24, 102601, 0.0, "リン", "このままじゃ\nまっひ～に\n叱られちゃうよ", 24009);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES (4, "2020/04/30 12:00:00", 9, 0.0, 0.0, 10040, 4, "2030/12/17 14:59:59", 24, 102601, 0.0, "リン", "まじめに\nやったんだけどな…\n悔しいな～", 24010);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES (4, "2020/04/30 12:00:00", 10, 0.0, 0.0, 10040, 4, "2030/12/17 14:59:59", 24, 102601, 0.0, "リン", "やられた…\nねずみって意外と\nてごわいね", 24011);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES (4, "2020/04/30 12:00:00", 11, 0.0, 0.0, 10040, 4, "2030/12/17 14:59:59", 24, 102601, 0.0, "リン", "おのれ～\nあたしのチーズを\n盗みやがって～！", 24012);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES (1, "2020/04/30 12:00:00", 12, 0.0, 1.81, 10040, 4, "2030/12/17 14:59:59", 24, 102601, 0.0, "リン", "疲れた…\nけど、次こそは\n守り抜くよ…", 24013);
